export const storesNames = [
  { name: 'Steam', value: <i className="fa-brands fa-square-steam"></i> },
  {
    name: 'PlayStation Store',
    value: <i className="fa-brands fa-playstation"></i>,
  },
  { name: 'Xbox Store', value: <i className="fa-brands fa-xbox"></i> },
  { name: 'Xbox 360 Store', value: <i className="fa-brands fa-xbox"></i> },
  {
    name: 'App Store',
    value: <i className="fa-brands fa-app-store-ios"></i>,
  },
  { name: 'GOG', value: <i className="fa-solid fa-gamepad"></i> },
  { name: 'Nintendo Store', value: <i className="fa-solid fa-gamepad"></i> },
  {
    name: 'Google Play',
    value: <i className="fa-brands fa-google-play"></i>,
  },
  { name: 'itch.io', value: <i className="fa-brands fa-itch-io"></i> },
  { name: 'Epic Games', value: <i className="fa-solid fa-gamepad"></i> },
]

